import React from 'react';

import { useState, useEffect } from 'react';

import LiftConsoleButton from './lift_console_button';

const Fetch = () => {
  const [data, setData] = useState([]);
  useEffect(() => {
    fetch('http://127.0.0.1:8000//api/lift/config/')
      .then((res) => {
        console.log(res)
        return res.json();
      })
      .then((data) => {
        console.log(data["lifts"]);
        setData(data["lifts"]);
      });
  }, []);
  return <div> { 
    data.map((lift) => ( 
        lift["serviced_floors"].map((floor) => (
        <LiftConsoleButton index={floor}/>
        ))
    )) 
    } </div>
};
export default Fetch;
